import React from 'react';
import { motion } from 'framer-motion';
import { Sparkles, Twitter, Github, Mail } from 'lucide-react';

const Footer = () => {
  const footerStyles = {
    footer: {
      background: 'rgba(255, 255, 255, 0.1)',
      backdropFilter: 'blur(10px)',
      borderTop: '1px solid rgba(255, 255, 255, 0.1)',
      marginTop: '4rem',
    },
    container: {
      maxWidth: '1200px',
      margin: '0 auto',
      padding: '3rem 1rem',
    },
    grid: {
      display: 'grid',
      gridTemplateColumns: 'repeat(1, 1fr)',
      gap: '2rem',
    },
    brand: {
      display: 'flex',
      alignItems: 'center',
      gap: '0.5rem',
      marginBottom: '1rem',
    },
    gradientText: {
      background: 'linear-gradient(45deg, #667eea, #764ba2, #f093fb)',
      WebkitBackgroundClip: 'text',
      WebkitTextFillColor: 'transparent',
      backgroundClip: 'text',
    },
    linkList: {
      listStyle: 'none',
    },
    link: {
      color: '#d1d5db',
      textDecoration: 'none',
      transition: 'color 0.3s ease',
    },
    bottom: {
      borderTop: '1px solid rgba(255, 255, 255, 0.1)',
      paddingTop: '2rem',
      marginTop: '2rem',
      display: 'flex',
      flexDirection: 'column',
      alignItems: 'center',
      gap: '1rem',
    },
    socialLinks: {
      display: 'flex',
      gap: '1rem',
    },
  };

  return (
    <motion.footer
      initial={{ opacity: 0 }}
      animate={{ opacity: 1 }}
      transition={{ delay: 0.5 }}
      style={footerStyles.footer}
    >
      <div style={footerStyles.container}>
        <div style={footerStyles.grid}>
          {/* Brand */}
          <div>
            <motion.div whileHover={{ scale: 1.05 }} style={footerStyles.brand}>
              <Sparkles size={24} color="#d8b4fe" />
              <span style={{ ...footerStyles.gradientText, fontSize: '1.25rem', fontWeight: 'bold' }}>
                VeriCreate
              </span>
            </motion.div>
            <p style={{ color: '#d1d5db', maxWidth: '24rem' }}>
              AI-powered content creation with blockchain verification. 
              Create stunning social media content and prove its authenticity.
            </p>
          </div>

          {/* Links */}
          <div>
            <h3 style={{ color: 'white', fontWeight: 600, marginBottom: '1rem' }}>Product</h3>
            <ul style={footerStyles.linkList}>
              {['Features', 'Pricing', 'API', 'Documentation'].map((item) => (
                <li key={item} style={{ marginBottom: '0.5rem' }}>
                  <a href="#" style={footerStyles.link}>{item}</a>
                </li>
              ))}
            </ul>
          </div>

          <div>
            <h3 style={{ color: 'white', fontWeight: 600, marginBottom: '1rem' }}>Company</h3>
            <ul style={footerStyles.linkList}>
              {['About', 'Blog', 'Careers', 'Contact'].map((item) => (
                <li key={item} style={{ marginBottom: '0.5rem' }}>
                  <a href="#" style={footerStyles.link}>{item}</a>
                </li>
              ))}
            </ul>
          </div>
        </div>

        {/* Bottom */}
        <div style={footerStyles.bottom}>
          <p style={{ color: '#d1d5db', fontSize: '0.875rem' }}>
            Â© 2024 VeriCreate. All rights reserved.
          </p>
          <div style={footerStyles.socialLinks}>
            {[Twitter, Github, Mail].map((Icon, index) => (
              <motion.a
                key={index}
                href="#"
                whileHover={{ scale: 1.2, y: -2 }}
                style={{ color: '#d1d5db' }}
              >
                <Icon size={20} />
              </motion.a>
            ))}
          </div>
        </div>
      </div>
    </motion.footer>
  );
};

export default Footer;
